import styled from 'styled-components';

export const DashboardContainer = styled.div`
  padding: 0;
  max-width: 1110px;
  margin: 0 auto;

  .top-nav {
    margin: 0 -9999rem;
    padding: 0 9999rem;
    background: #1F2640;
  }
`;
